import { useState } from 'react';
import './App.css';
import Main from './main';

function App() {
  // State variables
  const [enable, setEnable] = useState(false);
  const [isOpen, setOpen] = useState(false);
  const [videoFile, setVideoFile] = useState(null);
  const [uploader, setUploader] = useState("");
  const [latestList, setLatestList] = useState([]); // Fixed variable name to camelCase
  const [selectedVideoID, setSelectedVideoID] = useState(null);
  const [title, setTitle] = useState(null); // Fixed variable name to camelCase
  const [uploadSuccess, setUploadSuccess] = useState(false); // Fixed variable name to camelCase
  const [sub, setSub] = useState(null);
  const [searchTerm, setSearchTerm] = useState(''); // Fixed variable name to camelCase

  return (
    <div>
      <Main
          enable={enable}
          setEnable={setEnable}
          isOpen={isOpen}
          setOpen={setOpen}
          videoFile={videoFile}
          setVideoFile={setVideoFile}
          uploader={uploader}
          setUploader={setUploader}
          latestList={latestList} // Changed to camelCase
          setLatestList={setLatestList}
          selectedVideoID={selectedVideoID}
          setSelectedVideoID={setSelectedVideoID}
          title={title} // Changed to camelCase
          setTitle={setTitle}
          uploadSuccess={uploadSuccess} // Changed to camelCase
          setUploadSuccess={setUploadSuccess}
          sub={sub}
          setSub={setSub}
          searchTerm={searchTerm} // Changed to camelCase
          setSearchTerm={setSearchTerm}
      />
    </div>
  );
}

export default App;
